Template.adminDashboard.helpers({
	users: function() {
		return Meteor.users.find();
	},
	userRole: function() {
		var optionValue = 'Admin';
		if(this.profile.role === 'Admin') {
			$("#userRole").val(optionValue).find("option[value=" + optionValue +"]").attr('selected', true);
		}
	}
});
